import React from 'react';
import Card from '../Card/Card';
import './CardGrid.css';

const CardGrid = ({ forecasts }) => {
  console.log("CardGRID ", forecasts);
  return (
    <div>
      {
        forecasts.map((forecast, i) => {
          return (
            <Card
              key={i}
            />
          );
        })
      }
    </div>
  );
}

export default CardGrid;
